import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the sort select to appear (by id)
    await page.waitForSelector('#sortSelect', { timeout: 5000 });

    // Take screenshot before applying sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_sort.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_sort.png'));

    // Apply "Price: Low to High" sort filter
    await page.selectOption('#sortSelect', { value: 'price-low' });

    // Wait for the products grid/list to update (look for a product card)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after applying sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_sort.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_sort.png'));

    // Extract the first 3 product titles and prices to verify sorting
    const products = await page.$$eval(
      '.product-card, .product-card-list',
      nodes => nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = node.querySelector('.product-price')?.textContent || '';
        // Extract first price as float
        const priceMatch = priceText.match(/\$([0-9,.]+)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied Price: Low to High sort filter and verified sorted product data",
      extractedData: {
        firstThreeProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
